INSERT INTO `company_info` VALUES ('2', '2', '陕西科技创业投资管理有限公司', '陕西省西安市高新区丈八五路陕西省科技资源中心办公楼C404室', '陕西科技创投是陕西的一家创业投资管理公司，位于陕西省西安市高新区丈八五路10号（陕西省科技资源统筹中心）陕西科技创投主要面向科技型中小微企业，提供股权投资、创业辅导、资本运作、战略咨询、财务顾问、众筹融资服务搭建了西部首家股权众筹平台。证明材料来自陕西省人民政府、科学技术部网站。', '', '', '开业');
