INSERT INTO `company_info` VALUES ('8', '8', '浙江中新力合科技金融服务股份有限公司', '长兴经济技术开发区明珠路1278号', '浙江中新力合科技金融服务有限责任公司由浙江省科技厅牵头,浙江各市县科技局支持,联合中新力合股份有限公司与浙江省科技风险投资有限公司,以及16家股东共同发起成立的,致力于为全省科技型企业提供综合金融服务的平台类公司,注册资本3亿元,公司是浙江省首家科技金融服务公司。    2015年7月22日,浙江中新力合科技金融服务有限责任公司更名为浙江中新力合科技金融服务股份有限公司。', '', '', '存续');
