INSERT INTO `company_info` VALUES ('93', '112', '中青金融街科技有限公司', '天津自贸试验区（中心商务区）滨海华贸中心-723', '中青金融街科技有限公司是位于北京的一家供应链金融服务商。拥有中青旅实业、金融街控股等多家央企和上市公司股东背景，专注于科技产业和金融产业的结合创新，旗下拥有涉及大数据应用、供应链金融、个人消费金融、移动互联网领域的多家全资子公司，在中国市场拥有完备的服务团队和研发团队，是覆盖中国地区云计算服务的主流供应商之一。中青金融街科技旗下产业包括：供应链管理及供应链金融业务、互联网金融服务、个人消费金融。', '', '', '存续');
