INSERT INTO `company_info` VALUES ('109', '128', '东吴（苏州）金融科技有限公司', '苏州高新区科创路18号', '东吴在线是东吴证券旗下金融科技综合服务平台,由东吴证券、赢时胜、奥飞娱乐等共同设立。响应 “互联网+”国家战略，秉承 “只提供最有价值的金融服务”理念\n，运用互联网信息技术，致力为个人和机构投资者提供可信赖、智能化的综合金融服务。', '', '', '存续');
INSERT INTO `company_info` VALUES ('110', '129', '深圳中兴飞贷金融科技有限公司', '深圳市南山区科苑路11号金融科技大厦A座二十一层A、B、C、D单元，二十二层A、B、C、D单元', '飞贷金融，全称深圳中兴飞贷金融科技有限公司，是一家依托移动互联网技术，致力于不断提升用户贷款服务体验的互联网金融公司。“飞贷金融”专注于移动互联网金融领域的探索与实践，以用户需求为核心价值，全力打造手机App贷款品牌“飞贷”，为广大用户提供随借随还的手机App贷款服务。', '', '', '存续');
