INSERT INTO `company_info` VALUES ('112', '131', '宁波盛世蓝图金融科技有限公司', '浙江省宁波市北仑区梅山大道商务中心十一号办公楼325室', '宁波盛世蓝图金融科技有限公司创立于2014年。是由一批长期在投资、金融、教育、互联网公司工作的专业人士、理财专家和热心投身于金融理财的业内外资深人士共同组成的专业化，多元化产业服务机构。公司主要提供财商教育、金融服务、互联网大数据、理财咨询，资本运营，项目落地等服务；致力于推动中国产业升级，为创业者、企业家注入资本的智慧，为中国企业及平台插上金融的翅膀，构建产业和金融之间的互动、互助、互惠、互利。　　公司拥有完整的教育课程体系，从顶级的资本运作系统到高端的财商教育系统、个人信用财富打造系统，以及落地实操系统，为客户提供精准、实效、实用的教育和服务，帮助中国企业家及创业者快速成长。　　公司秉承“成就客户，超越客户期望”的坚定信念，全力打造以《天生我财》系列课程为核心、以个人财富俱乐部及企业资乐会会员服务为主导，并整合相关非会员企业和合作企业资源，与政府和金融机构、社会资源无缝链接，形成盛世蓝图大数据共享平台，为客户提供全方位的增值服务，实现共享多赢。公司一直关注公益、回报社会，为此成立“蓝星公益基金会”，以助教敬老为核心，大力开展众多具有社会价值的公益活动。今后，公司将一如既往，矢志不渝，为成为中国最具价值的产业金融平台而努力奋斗！', '', '', '存续');
